import React from 'react';
import Comment from './Comment';

const CommentList = ({ comments, onDelete, onEdit, onReply }) => {
  return (
    <div className="comment-list">
      {comments
        .sort((a, b) => new Date(b.date) - new Date(a.date))
        .map((comment) => (
          <Comment
            key={comment.id}
            comment={comment}
            onDelete={onDelete}
            onEdit={onEdit}
            onReply={onReply}
          />
        ))}
    </div>
  );
};

export default CommentList;
